const fetch=require("node-fetch");module.exports=async function(r){if(!r)throw new Error("parameter url tidak boleh kosong!!");if(isUrl=/^https?:\/\//.test(r),!isUrl)throw new Error("Invalid URL");var{result:t}=await(await fetch("https://caliph.my.id/api/expandurl.php/?url="+encodeURIComponent(r))).json();return{status:200,creator:"Caliph",result:t}}.bind();